## Filters

Filters are used to filter the data that is being displayed in the table.

### Filtering by a single column

To filter by a single column, you can use the `filter` property in the column definition. The `filter` property can be a function that takes the value of the cell and returns a boolean indicating whether the cell should be included in the filtered data.

```jsx
const columns = [
  {
    field: 'name',
    headerName: 'Name',
    filter: (value) => value.startsWith('A'),
  },
  {
    field: 'age',
    headerName: 'Age',
    filter: (value) => value > 30,
  },
];
```

